import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Dogs from '../Components/Dogs';
import TopMenu from '../Components/Header';

function App() {
  return (
    <Routes>
      <Route path='/' element={<>
        <TopMenu/>
        <Dogs/>
        </>} />
      <Route path='/about/:id' element={<TopMenu />}/>
  </Routes>
  );
}

export default App;
